import './index.css';
import FrontPageRectangularShape from './components/Shape/FrontPageRectangularShape'

function App() {

  return (
    <div className="App">
      <div className="h-screen bg-gradient-to-b from-backgroundcolor_top to-backgroundcolor_bottom shadow-inner flex items-center justify-center"></div>
      <FrontPageRectangularShape />
    </div>
  );
}

export default App;
